<?phpnamespace Nemundo\Roundshot\App\Container\Install;use Nemundo\App\Application\Setup\ApplicationSetup;use Nemundo\App\Application\Type\Install\AbstractInstall;use Nemundo\Content\Setup\ContentTypeSetup;use Nemundo\Model\Setup\ModelCollectionSetup;use Nemundo\Roundshot\App\Container\Application\ContainerApplication;use Nemundo\Roundshot\App\Container\Content\RoundshotContainer\RoundshotContainerContentType;use Nemundo\Roundshot\App\Container\Data\ContainerModelCollection;use Nemundo\Roundshot\Application\RoundshotApplication;class ContainerInstall extends AbstractInstall{    public function install()    {        (new ApplicationSetup())->addApplication(new ContainerApplication());        (new ModelCollectionSetup())->addCollection(new ContainerModelCollection());        (new ContentTypeSetup(new RoundshotApplication()))            ->addContentType(new RoundshotContainerContentType());    }}